import React, { useState } from "react";


const Example = () => {
    const contacts = [
        {
          name: "John Doe",
          mobile: "1234567890",
          email: "john@example.com",
          gender: "male"
        },
        {
          name: "Jane Smith",
          mobile: "0987654321",
          email: "jane@example.com",
          gender: "female"
        },
        {
          name: "Michael Johnson",
          mobile: "3456789012",
          email: "michael@example.com",
          gender: "male"
        },
        {
          name: "Emily Davis",
          mobile: "5678901234",
          email: "emily@example.com",
          gender: "female"
        },
        {
          name: "David Brown",
          mobile: "7890123456",
          email: "david@example.com",
          gender: "male"
        }
      ];
      
    const [state, setState] = useState({
        columns: ['sno','Name','Mobile Number','Email','Gender'],
        rowData: []
    });

    return (
        <>
             
        </>
    )
}
export default Example;
